import React from "react";
import { SpreadSheets, Worksheet } from "@grapecity/spread-sheets-react";
import { IO } from "@grapecity/spread-excelio";
import { data } from "./data/spreadJson.js";
import GC from "@grapecity/spread-sheets";

const SheetArea = GC.Spread.Sheets.SheetArea;
let spread = null;

function SpreadSheet() {
  let hostStyles: any = { width: "100%", height: "600px" };
  return (
    <div>
      <SpreadSheets
        hostStyle={hostStyles}
        workbookInitialized={(spread) => initSpread(spread)}
      >
        <Worksheet></Worksheet>
      </SpreadSheets>
    </div>
  );
}
function initSpread(spread_local: any) {
  spread = spread_local;
  spread.options.calcOnDemand = true;
  let sheet = spread.getActiveSheet();

  sheet.setRowCount(2, SheetArea.colHeader);
  sheet.setColumnCount(0, SheetArea.rowHeader);

  sheet.setRowCount(4);
  sheet.setColumnCount(7);

  sheet.addSpan(1, 1, 1, 3, SheetArea.colHeader);
  sheet.addSpan(1, 4, 1, 3, SheetArea.colHeader);

  sheet.setValue(1, 0, "Cash flow catergories", SheetArea.colHeader);
  sheet.setValue(1, 1, "Actual Section", SheetArea.colHeader);
  sheet.setValue(1, 4, "Forecast", SheetArea.colHeader);
  sheet.setValue(0, 1, "T-Current(-3/week/month)");
  sheet.setValue(0, 2, "T-Current(-2/week/month)");
  sheet.setValue(0, 3, "T-Current(-1/week/month)");
}

export default SpreadSheet;
